import { Box, Tab, Tabs } from '@mui/material';
import * as React from 'react';
import { useNavigate, useLocation } from 'react-router-dom';
import { DataGrid, GridColDef, GridValueGetterParams } from '@mui/x-data-grid';

const Bookmark: React.FC = () => {
    const navigate = useNavigate();
    const { state } = useLocation();

    const goUserInfo = () => {
        navigate('/userinfo')
    };
    const goBookmark = (state: number) => {
        navigate('/bookmark',  { state: state })
    };
    const goResume = (state: number) => {
        navigate('/myresume',  { state: state })
    };
    const goManage = (state: number) => {
        navigate('/manage',  { state: state })
    };

    function a11yProps(index: number) {
        return {
            id: `simple-tab-${index}`,
            'aria-controls': `simple-tabpanel-${index}`,
        };
    }

    const handleChange = (event: React.SyntheticEvent, newValue: number) => {
        setValue(newValue);
    };

    const [value, setValue] = React.useState(state);

    const columns: GridColDef[] = [
        { field: 'num', headerName: 'No', width: 130, type: 'number'},
        { field: 'name', headerName: '기업명', width: 130},
        { field: 'location', headerName: '위치', width: 130 },
        { field: 'keyword', headerName: '키워드', width: 130 },
    ];

    const rows = [
        { id: 1, lastName: 'Snow', firstName: 'Jon', age: 35 },
        { id: 2, lastName: 'Lannister', firstName: 'Cersei', age: 42 },
        { id: 3, lastName: 'Lannister', firstName: 'Jaime', age: 45 },
        { id: 4, lastName: 'Stark', firstName: 'Arya', age: 16 },
        { id: 5, lastName: 'Targaryen', firstName: 'Daenerys', age: null },
        { id: 6, lastName: 'Melisandre', firstName: null, age: 150 },
        { id: 7, lastName: 'Clifford', firstName: 'Ferrara', age: 44 },
        { id: 8, lastName: 'Frances', firstName: 'Rossini', age: 36 },
        { id: 9, lastName: 'Roxie', firstName: 'Harvey', age: 65 },
      ];
    return (
        <div className='bookmark'>
            <Box sx={{ borderBottom: 1, borderColor: 'divider' }}>
                <Tabs value={value} onChange={handleChange} aria-label="basic tabs example">
                    <Tab label="회원정보" {...a11yProps(0)} onClick={() => { goUserInfo(); } }/>
                    <Tab label="북마크" {...a11yProps(1)} onClick={() => { goBookmark(1); } }/>
                    <Tab label="이력서" {...a11yProps(2)} onClick={() => { goResume(2); } } />
                    <Tab label="자소서 관리" {...a11yProps(3)} onClick={() => { goManage(3); } } />
                </Tabs>
            </Box>
        </div>
    );
};
export default Bookmark;
